description:
The World Is Hers

She Started With Nothing And Became Everything

Meet Toni Luvana, a poor Cuban refugee that would rule an empire. Her appetite for power and her sexual desires let no one stand in the way. Together with angel they work for crime boss Tommy Gunn. Life is good until sex, drugs and greed get in the way. It's not long until Toni is in too deep. See what happens when everything isn't enough.

